import UserPerformanceData from '../core/UserPerformanceData'

export default class UserPerformanceMapper {
    static convertToUserPerf(json) {
        return new UserPerformanceData(
            json.userId,
            json.data[0].value,
            json.energy,
            json.strengh,
            json.speed,
            json.intensity
        )
    }
}
